    <p class=MsoNormal style='margin-bottom:2.0pt'><b><span lang=EN-GB

    <p class=MsoNormal style='margin-bottom:2.0pt'><span lang=EN-GB
    style='mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;
    mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:
    "Open Sans Light";color:#9C9C90;letter-spacing:-.9pt'>Fun and interactive,
    browser based, classic game of Tic Tac Toe, designed using JavaScript,
    HTML, CSS and Pure (Frame Work). <span
    style='mso-spacerun:yes'>&nbsp;</span><o:p></o:p></span></p>
    <p class=MsoNormal style='margin-bottom:2.0pt'><b><span lang=EN-GB
    style='mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;
    mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:
    "Open Sans Light";color:#9C9C90;letter-spacing:-.9pt'>Stream Line<o:p></o:p></span></b></p>
    <p class=MsoNormal style='margin-bottom:2.0pt'><span lang=EN-GB
    style='mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;
    mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:
    "Open Sans Light";color:#9C9C90;letter-spacing:-.9pt'>Simple and easy way
    to make reservations in a restaurant, build in Ruby on Rails platform,
    successfully incorporated Web Socket to maintain two way connections.<o:p></o:p></span></p>
    <p class=MsoNormal style='margin-bottom:2.0pt'><b><span lang=EN-GB
    style='mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;
    mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:
    "Open Sans Light";color:#9C9C90;letter-spacing:-.9pt'>Vintage Car
    Collection<o:p></o:p></span></b></p>
    <p class=MsoNormal style='margin-bottom:2.0pt'><span lang=EN-GB
    style='mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;
    mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:
    "Open Sans Light";color:#9C9C90;letter-spacing:-.9pt'>Online web forum for
    Classic Car enthusiast, to make comments as well as create new discussions,
    developed using Ruby on Rails, HTML/CSS</span><span lang=EN-GB
    style='font-family:"Open Sans Light","sans-serif";mso-bidi-font-family:
    "Open Sans Light";color:#9C9C90;letter-spacing:-.9pt'>.<o:p></o:p></span></p>
